import React from 'react';
import '../App.css';

function Login() {
    return (
        <div>
            <h1>Login Page</h1>
            <form action='api/auth' method='POST'>
                <input
                    type='text'
                    name='username'
                    placeholder='Username'
                    required
                />
            </form>
        </div>
    );
}

export default Login;
